import React from 'react';
import styled from 'styled-components';

import { Header, Row, Container } from '../../shared';
import { ShoppingBag } from '@styled-icons/boxicons-regular';

const NavBar = styled(Row)`
  display: flex;
  justify-content: space-between;
  align-items: center;
  height: 60px;
  ul {
    font-size: 1.8rem;
    display: flex;
    list-style: none;
    text-decoration: none;
    justify-content: space-between;
  }
`;

const NavigationBar = () => {
  return (
    <Header>
      <NavBar>
        <div>
          <img src="#" alt="logo" />
        </div>
        <div>
          <ul>
            <li>
              <a href="#">SHOP</a>
            </li>
            <li>
              <a href="#">CONTACT</a>
            </li>
            <li>
              <a href="#">SIGN IN</a>
            </li>
            <li>
              <a href="#">
                <ShoppingBag size="20" title="Shopping Bag" />
              </a>
            </li>
          </ul>
        </div>
      </NavBar>
    </Header>
  );
};

export default NavigationBar;
